#include <iostream>
#include <conio.h>
#include <ctime>
using namespace std;

void merge(int arr[],int l,int mid,int h)
{
	int L1 = mid - l + 1;
	int L2 = h - mid;
	int S1[L1];
	int S2[L2];
	for(int i = 0;i<L1;i++)
	{
		S1[i] = arr[l + i];
	}
	for(int j = 0;j<L2;j++)
	{
		S2[j] = arr[mid + 1 + j];
	}
	int i = 0;
	int j = 0;
	int k;
	for(k = l;i<L1 && j<L2;k++)
	{
		if(S1[i] <= S2[j])
		{
			arr[k] = S1[i];
			i++;
		}
		else
		{
			arr[k] = S2[j];
			j++;
		}
		
	}
	while(i<L1)
	{
		arr[k] = S1[i];
		i++;
		k++;
	}
	while(j<L2)
	{
		arr[k] = S2[j];
		j++;
		k++;
	}
}
void mergesort(int arr[],int l,int h)
{
	if(l<h)
	{
		int mid = (l+h)/2;
		mergesort(arr,l,mid);
		mergesort(arr,mid+1,h);
		merge(arr,l,mid,h);
	}	
}






